        // complete the order
        _buyOrder(orderId, amount);
        _mint(msg.sender, amount); // transfer token to buyer

        emit orderFulfilled(orderId, amount, block.timestamp, msg.sender, order.seller);
    }

    // User: Update the price of a sell order
